import React from 'react';
import ReactDOM from 'react-dom';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Card from 'reactstrap';
import Button from 'react-bootstrap/Button';
import MaterialIcons from 'material-icons-react';
import Figure from 'react-bootstrap/Figure';
import Image from 'react-bootstrap/Image'
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Table from 'react-bootstrap/Table';
import Tabs from 'react-bootstrap/Tabs';
import Tab from 'react-bootstrap/Tab'
import Sweetalert from 'react-bootstrap-sweetalert';

class moderatorSingleEvent extends React.Component {
  render() {
    return(
        <div style = {{backgroundColor: "#25274d"}} cols = {5} value = {this.props.eventId}>
          <Container fluid = {true}>
              <Card width = "10">
                <CardBody>
                  <CardImg width = "0.5" height = "150" src={process.env.PUBLIC_URL + 'images/events_medium.jpg'} alt="Card image cap" thumbnail/>
                  <CardTitle><CardLink href = "#">Event Name</CardLink></CardTitle>
                  <CardSubtitle>Date, Time</CardSubtitle>
                  <CardText>Event Description <a href = "#">[More...]</a></CardText>
                    <div>
                        <Button className="float-left">Edit</Button>&nbsp;
                        <Button>Delete</Button>
                    </div>
                </CardBody>
              </Card>
          </Container>
          <hr/>
        </div>
    )
  }
}

export default moderatorSingleEvent;
